import React from 'react';
import './Total.css';

const Total = (props) => (
  <p>
    {(() => console.log(props.course.parts))()}
    Number of exercises:{' '}
    {props.parts
      .map((part) => part.exercises)
      .reduce((total, value) => total + value, 0)}
  </p>
);
export default Total;
